- input: "TEXT\x1CC00172619\x1C.TEXT\x1C\x1CF3N\x1CDear Ms. Hough:In response to your
    letter of May 7, 2010 that listed 2 items that needed further information.\tThere
    were four checks that fell within the 48 Hour Reporting  period, I have researched
    the checks and found the following.  Each of the check was received after the
    48 Hour Reporting period but instead of recording the date that I received the
    check, I picked up the date on the check when it was written.  I am mailing you
    copies of the check so that you can see that I picked up those wrong dates.   I
    am unable to copy them to the electronic reporting system. For the second question,
    I have no explanation because the procedure for reporting a last minute contribution
    is to record it on Schedule A and then clone it to the 48 Hour Report.  There
    is no way that I know of to report a last minute contribution without first reporting
    it on Schedule A.  I have amended the report to show the contribution.\n"
